import React from 'react';
import  styled from 'styled-components';

const StyledMain = styled.div`
  display: grid;
  grid-template-rows:  1fr 1fr auto;
  grid-template-columns: 100%;
  width: 80%;
`

const Main = props => <StyledMain>{props.children}</StyledMain>

export default Main;
